import { StyleSheet } from 'react-native';
import Constants from 'expo-constants';


export default StyleSheet.create({
  container: {
    flex: 1,
    paddingHorizontal: 24,
    paddingTop: Constants.statusBarHeight,
  },
  titulo: {
    fontSize: 30,
    marginBottom: 16,
    marginTop: 48,
    color: '#2AB940',
    fontWeight: 'bold',
    textAlign: 'center'
  },

  descricao: {
    fontSize: 16,
    lineHeight: 24,
    color: '#737380',
    textAlign: 'center'
  },

  listaProjetos: {
    marginTop: 32
  },

  projeto: {
    padding: 24,
    borderRadius: 8,
    backgroundColor: '#fff',
    marginBottom: 16,
  },

  projetoTipo: {
    fontSize: 14,
    color: '#41414d',
    fontWeight: 'bold'
  },

  projetoNome: {
    marginTop: 8,
    fontSize: 15,
    marginBottom: 16,
    color: '#737380'
  },

  botaoDetalhes: {
    flexDirection: 'row',
    justifyContent: 'center',
    alignItems: 'center'
  },
});
